import * as React from "react";
import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import Paper from "@mui/material/Paper";
import { Container } from "@mui/material";

import Grid from "@mui/material/Grid";

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

export function BasicGrid() {
  return (
    <Container>
      <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Nesciunt voluptatem debitis officia laudantium dolorum. Obcaecati, optio placeat blanditiis sed, nam cupiditate est excepturi cum reprehenderit, laudantium debitis reiciendis architecto voluptates?</p>
    </Container>
  );
}
